let containerStyle = {
  display: "flex",
  width: "calc(65vw - 28px)",
  minWidth: "400px",
  marginTop: "-10px",
  fontWeight: "bold"
}

let macStyle = {
  listStyleType: "none",
  fontSize: "17px",
  minWidth: "200px",
  height: "22px",
  marginTop: "16px",
  textAlign: "center",
  borderRadius: "3px",
  fontWeight: "bold"
}

let macStyleHighlighted = {
  ...macStyle, backgroundColor: "#4382BC",
}

let ulStyle = {
  listStyleType: "none",
  display: "flex",
  width: "100%",
  height: "10px",
  fontWeight: "bold"
}

let liStyle = {
  width: "calc(20% - 11px)",
  marginLeft: "-200px"
  // height: "2px",
  // marginBottom: "3px",
  // textAlign: "center",
  // borderRadius: "3px",
  // fontWeight: "bold"
}

let liStyleHighlighted = {
  ...liStyle, backgroundColor: "#4382BC",
}

let indexSeparatorContainer = {
  width: "11px", 
  height: "22px", 
  cursor: "col-resize"
}

let indexSeparator = {
  display: "block",
  marginLeft: "auto",
  marginRight: "auto",
  width: "1px", 
  height: "22px", 
  backgroundColor: "#4382BC"
}

export {
  containerStyle,
  macStyle,
  macStyleHighlighted,
  ulStyle,
  liStyle,
  liStyleHighlighted,
  indexSeparator,
  indexSeparatorContainer
}
